import React from "react";

const InfoSection = () => {
  return (
    <div style={{ width: "100%" }}>

      <div style={{ backgroundColor: "#231f20", padding: "2px 0" }}>
        <img
          src="/assets/logo.png"
          alt="University of the Pacific Logo"
          style={{ width: "2in", marginTop: "5px", marginLeft: "10px" }}
        />
      </div>


      <img
        src="/assets/UOP Banner1.jpg"
        alt="Pacific Campus Banner"
  style={{
    width: "100%",
    height: "270px",         // ðŸ‘ˆ Set a fixed height
    objectFit: "cover",      // ðŸ‘ˆ Crop image nicely without distortion
    display: "block",
  }}
      />

      {/* ðŸ“˜ Info Text Section */}
      <div
        style={{
          fontFamily: "Neuzeit Grotesk, sans-serif",
          fontSize: "13pt",
          lineHeight: "17pt",
          color: "#231f20",
          maxWidth: "900px",
          margin: "40px auto",
        }}
      >



      </div>
    </div>
  );
};

export default InfoSection;
